import React, { Component } from 'react';
import Question from './question';

export default class Questions extends Component {
  state = {
    questions: [
      {
        id: 1,
        question: "Hvem av disse forfatterene sto med nazistene under okkupasjonstiden?",
        options: ["Knut Hamsun", "Henrik Ibsen", "Jens Bjørneboe"],
        correct: 2,
      },

      {
        id: 2,
        question: "\[\frac45\]",
        options: ["UwU", "OwO", "-W-"],
        correct: 1,
      },

      {
        id: 3,
        question: "Hi there",
        options: ["Oh hi Mark", "Hei"],
        correct: 1,
      },
      {
        id: 4,
        question: "Hi there",
        options: ["Oh hi Mark", "Hei"],
        correct: 1,
      },
      {
        id: 5,
        question: "Hi there",
        options: ["Oh hi Mark", "Hei"],
        correct: 1,
      },
      {
        id: 6,
        question: "Hi there",
        options: ["Oh hi Mark", "Hei"],
        correct: 1,
      },
    ]
  };

  render() {
    var classes = "column is-one-third"
    return (
      <div>
        <div className={classes}>
          { this.state.questions.map(question => <Question key={question.id} id={question.id} question={question.question} options={question.options} correct={question.correct}/>) }
        </div>
      </div>
    )
  }
}
